			createWeatherSatImages: function(uId)
			{
				/// <summary>
				/// s the specified u identifier.
				/// </summary>
				/// <param name="uId">The u identifier.</param>
				/// <returns></returns>
				let urlHttps;
				let url;
				let satImage = "";
				let timezone = getTimezoneName();
				timezone = timezone.replace(".", "_dot_");

				$("#imagesContainer-" + uId).empty();

				if (this.options.satImageEnabled)
				{
					if (this.options.debug)
					{
						console.info("Function for creating Satellite images called.");
					}

					let result = this.options.satImageLocations;
					let imageSize = this.options.satImageSize;
					let debug = this.options.debug;

					if (result.length)
					{
						if (debug)
						{
							console.info("Array of satellite images is set. It counts - " + result.length + " images.");
							console.info("--------------------------------------------");
						}

						// Now loop trough each image and load src
						$.each(result,
							function(i, value)
							{
								/// <summary>
								/// s the specified i.
								/// </summary>
								/// <param name="i">The i.</param>
								/// <param name="value">The value.</param>
								/// <returns></returns>
								$("SatImage-" + uId + "-" + i).hide();
								satImage += '<article class="weatherCubeSatImage col-xl-3 col-lg-6 text-center">' +
									'<div class="satImage p-2">' +
									showWeatherLoader(uId + "-" + i) +
									'<img id="SatImage-' +
									uId +
									"-" +
									i +
									'" src="" alt="SatImage" class="img-fluid" />' +
									"</div>" +
									"</article>";

								// Check if provided region is valid if not exit loop
								if ($.inArray(value["region"], satImageRegions) < 0)
								{
									if (debug)
									{
										console.info("Selected region is invalid: " + value["region"]);
									}

									return;
								}

								if (debug)
								{
									console.info("Selected region is valid: " + value["region"]);
								}

								// Check what sort of image do we want. Animated GIF or static PNG
								if (value["animated"])
								{
									// Check if provided type is valid if not exit loop
									if ($.inArray(value["type"], satAnimatedImageTypes) < 0)
									{
										if (debug)
										{
											console.error("Selected image type is invalid: " +
												value["type"] +
												". Allowed types are: " +
												satAnimatedImageTypes.toString());
										}

										return;
									}

									if (debug)
									{
										console.info("Selected Satellite image type is animated.");
									}

									url = apiSatAnimatedImage.replace("{0}", value["region"]);
									url = url.replace("{1}", value["type"]);
									url = url.replace("{2}", imageSize);

									if (typeof (timezone) != "undefined" && timezone != null && timezone !== "")
									{
										url = url.replace("{3}", timezone);
									}
									else
									{
										url = url.replace("{3}", "");
									}

									let randomNum = Math.floor((Math.random() * 10000000) + 1);
									url = url.replace("{4}", randomNum.toString());
									url = encodeURI(url);
									urlHttps = url.replace("http:", "https:");
								}
								else
								{
									if ($.inArray(value["type"], satVisualImageTypes) < 0)
									{
										if (debug)
										{
											console.error("Selected image type is invalid: " +
												value["type"] +
												". Allowed types are: " +
												satVisualImageTypes.toString());
										}

										return;
									}

									if (debug)
									{
										console.info("Selected Satellite image type is static.");
									}

									url = apiSatImage.replace("{0}", value["region"]);
									url = url.replace("{1}", value["type"]);
									url = encodeURI(url);
									urlHttps = url.replace("http:", "https:");
								}

								if (debug)
								{
									console.info("Everything seems to be ok. Try to load Image.");
									console.info("Getting visual satellite image for region: " + value["region"]);
								}

								let opts = {
									imgUrl: urlHttps,
									beforeLoad: function()
									{
										// Executes before starting to load image
									},
									complete: function()
									{
										$("#weather-" + uId + "-" + i).remove();
									},
									success: function(e)
									{
										$("#SatImage-" + uId + "-" + i).attr("src", e.imageElem.src);

										if (debug)
										{
											console.info("Successfully loaded satellite image for region- " +
												value["region"]);
										}
									},
									error: function()
									{
										if (debug)
										{
											console.error(
												"Error loading satellite image for region- " + value["region"]);
										}
									}
								};

								// Load each Image
								loadSatImage(opts);

								if (debug)
								{
									console.info("--------------------------------------------");
								}
							});
					}
					else
					{
						satImage += '<article class="weatherCubeSatImage col-12 text-center p-3 pb-1">' +
							'<div class="alert alert-danger" role="alert">' +
							"<strong>" + getI18n("satNotSet", this.options.language) + "</strong>" +
							"</div></article>";

						if (this.options.debug)
						{
							console.warn("Weather Satellite Images, are not set!");
						}
					}

					return satImage;
				}
				else
				{
					satImage += '<article class="weatherCubeSatImage col-12 text-center p-3 pb-1">' +
						'<div class="alert alert-danger" role="alert">' +
						"<strong>" + getI18n("satError", this.options.language) + "</strong>" +
						"</div></article>";

					if (this.options.debug)
					{
						console.warn("Weather Satellite Images, are disabled!");
					}

					return satImage;
				}
			},

