			updateEarthQuakeData: function(uId, data, earthquakeChart)
			{
				let widget = this;
				let html = "";

				if (this.options.debug)
				{
					console.info("Updating earthquake data!");
				}

				let earthquakeChartNames = [];
				let earthquakeChartStrength = [];

				earthquakeChart.clear();
				earthquakesArray.clearLayers();
				
				const LeafIcon = leaflet.Icon.extend({
					options: {
						iconSize: [95, 95]
					}
				});
				
				// Each each earthquake in a week
				$.each(data.features,
					function(i, item)
					{
						let style = "alert-info";
						let tsunami = getI18n("earthquakesTsunamiNo", widget.options.language);

						if (item.properties.mag < 3)
						{
							style = "alert-info";
						}
						else if (item.properties.mag > 3 && item.properties.mag < 5)
						{
							style = "alert-warning";
						}
						else if (item.properties.mag > 5 && item.properties.mag < 14)
						{
							style = "alert-danger";
						}
						else
						{
							style = "alert-info";
						}

						if (item.properties.tsunami > 0)
						{
							tsunami = getI18n("earthquakesTsunamiYes", widget.options.language);
						}

						let updateDate = new Date(item.properties.time);
						let day = (updateDate.getDate() < 10 ? "0" : "") + updateDate.getDate();
						let month = (updateDate.getMonth() < 9 ? "0" : "") + (updateDate.getMonth() + 1);
						let year = updateDate.getFullYear();
						let hours = updateDate.getHours();
						let minutes = updateDate.getMinutes();

						if (minutes < 10)
						{
							minutes = "0" + minutes;
						}
						let formattedDate = hours + ":" + minutes + " - " + day + "-" + month + "-" + year;

						earthquakeChartNames.push(formattedDate);
						earthquakeChartStrength.push(Math.round(item.properties.mag * 100) / 100);
						let coordLat = Math.round(item.geometry.coordinates[1] * 100) / 100;
						let coordLon = Math.round(item.geometry.coordinates[0] * 100) / 100;
						
						if (Math.round(item.properties.mag * 100) / 100 > 5)
						{
							let greenIcon = new LeafIcon({iconUrl: 'data:image/png;base64,'});
							leaflet.marker([coordLat, coordLon], {icon: greenIcon}).bindPopup(widget.createEarthquakePopup(Math.round(item.properties.mag * 100) / 100, getI18n("earthquakesTsunami", widget.options.language))).addTo(earthquakesArray);
						}
						
						html += '<article class="earthquakes text-warning">' +
							'<div class="alert ' +
							style +
							' d-flex justify-content-start" role="alert">' +
							'<div class="d-flex flex-column align-self-start justify-content-start mr-2 text-left">' +
							'<h5 class="text-semibold">' + getI18n("earthquakesTime", widget.options.language) +
							"</h5>" +
							'<h5 class="text-semibold digital-font">' +
							formattedDate +
							"</h5>" +
							'<hr class="p-1 m-0" />' +
							'<h5 class="text-semibold">' + getI18n("earthquakesLatitude", widget.options.language) +
							"</h5>" +
							'<h5 class="text-semibold digital-font">' +
							Math.round(item.geometry.coordinates[1] * 100) / 100 +
							"</h5>" +
							'<hr class="p-1 m-0" />' +
							'<h5 class="text-semibold">' + getI18n("earthquakesLongitude", widget.options.language) +
							"</h5>" +
							'<h5 class="text-semibold digital-font">' +
							Math.round(item.geometry.coordinates[0] * 100) / 100 +
							"</h5>" +
							"</div>" +
							'<div class="d-flex flex-column align-self-center align-items-center justify-content-center flex-grow-1 mr-2 text-left">' +
							'<h1 class="text-bold mr-2 digital-font d-flex align-self-center align-items-center justify-content-center">' +
							'<i class="wi wi-earthquake wi-fw text-info"></i>' +
							Math.round(item.properties.mag * 100) / 100 +
							"</h1>" +
							'<h3 class="text-semibold mr-2">' +
							item.properties.place +
							"</h3>" +
							'<hr class="p-1 m-0 w-50" />' +
							'<span class="text-uppercase">' +
							getI18n("earthquakesStatus", widget.options.language) +
							item.properties.status +
							"</span>" +
							"</div>" +
							'<div class="d-flex flex-column align-self-start justify-content-center mr-2 border-left border-warning p-2">' +
							'<span class="text-uppercase">' + getI18n("earthquakesTsunami", widget.options.language) +
							"</span>" +
							'<h3 class="text-uppercase">' +
							tsunami +
							"</h3>" +
							"</div>" +
							"</div>" +
							"</article>";
					});

				this.$element.find("#weatherEarthquakeArea-" + uId).empty().append(html);

				earthquakeChart.setOption({
					tooltip: {
						formatter: "{a} <br/>{b}: {c} (Mw)"
					},
					grid: {
						bottom: "10%"
					},
					legend: {},
					yAxis: {
						type: "value",
						axisLabel: {
							formatter: "{value} Mw",
							margin: 15
						}
					},
					xAxis: {
						type: "category",
						data: earthquakeChartNames
					},
					dataZoom: [
						{
							startValue: "2014-06-01"
						}, {
							type: "inside"
						}
					],
					visualMap: {
						top: 5,
						right: 5,
						pieces: [
							{
								gt: 0,
								lte: 1,
								color: "rgb(0,153,102)"
							}, {
								gt: 1,
								lte: 2,
								color: "rgb(255,222,51)"
							}, {
								gt: 2,
								lte: 5,
								color: "rgb(255,153,51)"
							}, {
								gt: 5,
								color: "rgb(189,40,27)"
							}
						],
						outOfRange: {
							color: "rgb(153,153,153)"
						}
					},
					series: [
						{
							name: getI18n("earthquakesStrength", this.options.language),
							data: earthquakeChartStrength,
							type: "bar",
							markPoint: {
								data: [
									{ type: "min", name: getI18n("earthquakesMaxStrength", this.options.language) },
									{ type: "max", name: getI18n("earthquakesMinStrength", this.options.language) }
								]
							},
							markLine: {
								silent: true,
								data: [
									{
										yAxis: 1
									}, {
										yAxis: 2
									}, {
										yAxis: 4
									}, {
										yAxis: 5
									}, {
										yAxis: 12
									}
								]
							}
						}
					]
				});

				earthquakeChart.hideLoading();
				earthquakeChart.resize();

				if (this.options.debug)
				{
					console.info("Earthquake list successfully updated!");
				}
			},

			updateMeteoAlarmData: function(debug, uId)
			{
				let widget = this;
				if (this.options.debug)
				{
					console.info("Updating meteo alarm data!");
				}

				let meteo = navigator.language || navigator || "uk";
				if (meteo === "sl")
				{
					meteo = "si";
				}
				else if (meteo === "en")
				{
					meteo = "uk";
				}

				if ($.inArray(meteo.toUpperCase(), europeRegions) < 0)
				{
					if (debug)
					{
						console.info("Selected region is invalid: " + meteo);
					}

					return;
				}

				let urlMeteo = apiMeteoAlarmUrl.replace("{0}", meteo.toLowerCase());
				$.getJSON("https://feed.jquery-plugins.net/load?url=" + encodeURIComponent(urlMeteo) + "&maxCount=50",
					function(result)
					{
						widget.$element.find("#weatherAlerts-" + uId).empty().append(result.data[0].description);
						if (widget.options.debug)
						{
							console.info("Successfully updated alerts list!");
						}
					});
			},

