			/***************************************************************************/

			getWeatherData: function(apiUrl,
			                         debug,
			                         uId,
			                         type,
			                         tempChart = false,
			                         humidityChart = false,
			                         pressureChart = false,
			                         windChart = false,
			                         earthquakeChart = false,
			                         tempWeekChart = false,
			                         humidityWeekChart = false,
			                         pressureWeekChart = false,
			                         windWeekChart = false)
			{
				let widget = this;
				$.ajax({
					url: apiUrl,
					cache: false,
					crossDomain: true,
					success: function(data)
					{
						if (data)
						{
							if (debug)
							{
								console.info("Success, getting data for: " + apiUrl);
								console.log(data);
							}

							if (type === 1)
							{
								widget.updateCurrentWeather(uId, data);
							}
							else if (type === 2)
							{
								widget.updateUviWeather(uId, data);
							}
							else if (type === 3)
							{
								widget.updateForecastWeather(uId,
									data,
									tempChart,
									humidityChart,
									pressureChart,
									windChart,
									tempWeekChart,
									humidityWeekChart,
									pressureWeekChart,
									windWeekChart);
							}
							else if (type === 4)
							{
								widget.updateEarthQuakeData(uId, data, earthquakeChart);
							}
							else
							{
								if (debug)
								{
									console.error("Data type is wrong!");
								}
							}
						}
					},
					error: function(xhr, textStatus, thrownError)
					{
						if (debug)
						{
							console.error("Error getting JSON data from: " + apiUrl);
							console.error(thrownError + "\r" + xhr.statusText + "\r" + xhr.responseText);
						}
					}
				});
			},

			/***************************************************************************/

			createUniqId: function(idLength)
			{
				const charsToFormId = "_0123456789ABCDEFGHIJKLMNOPQRSTUVWXTZabcdefghiklmnopqrstuvwxyz".split("");
				if (!idLength)
				{
					idLength = Math.floor(Math.random() * charsToFormId.length);
				}

				let uniqId = "";
				for (let i = 0; i < idLength; i++)
				{
					uniqId += charsToFormId[Math.floor(Math.random() * charsToFormId.length)];
				}

				return uniqId;
			},

			/***************************************************************************/

			generateWindIcon: function(degree)
			{
				if (degree < 11.25 && degree > 348.75)
				{
					return "wi-wind wi-towards-n";
				}
				else if (degree > 11.25 && degree < 33.75)
				{
					return "wi-wind wi-towards-nne";
				}
				else if (degree > 33.75 && degree < 56.25)
				{
					return "wi-wind wi-towards-ne";
				}
				else if (degree > 56.25 && degree < 78.75)
				{
					return "wi-wind wi-towards-ene";
				}
				else if (degree > 78.75 && degree < 101.25)
				{
					return "wi-wind wi-towards-e";
				}
				else if (degree > 101.25 && degree < 123.75)
				{
					return "wi-wind wi-towards-ese";
				}
				else if (degree > 123.75 && degree < 146.25)
				{
					return "wi-wind wi-towards-se";
				}
				else if (degree > 146.25 && degree < 191.25)
				{
					return "wi-wind wi-towards-s";
				}
				else if (degree > 191.25 && degree < 213.75)
				{
					return "wi-wind wi-towards-ssw";
				}
				else if (degree > 213.75 && degree < 236.25)
				{
					return "wi-wind wi-towards-sw";
				}
				else if (degree > 236.25 && degree < 258.75)
				{
					return "wi-wind wi-towards-wsw";
				}
				else if (degree > 258.75 && degree < 281.25)
				{
					return "wi-wind wi-towards-w";
				}
				else if (degree > 281.25 && degree < 303.75)
				{
					return "wi-wind wi-towards-wnw";
				}
				else if (degree > 303.75 && degree < 326.25)
				{
					return "wi-wind wi-towards-nw";
				}
				else
				{
					return "wi-wind wi-towards-nnw";
				}
			},

			/***************************************************************************/

			// Separate 5 day 3-hourly forecast into daily 3-hourly forecasts
			separateForecastByDay: function(forecast)
			{
				let separatedForecast = new Array(5);

				for (let i = 0; i < separatedForecast.length; i++)
				{
					separatedForecast[i] = { 'date': null, 'forecast': [] };
				}

				let [dayIdx, prevForecastElDate] = [0];
				const today = new Date();

				for (let j = 0; j < forecast.length; j++)
				{
					let forecastEl = forecast[j];

					// .replace(/-/g, '/') added to resolve ES5 vs ISO-8601 specification gaps
					// fixes issue with date showing up as invalid in iOS
					const date = new Date(`${forecastEl.dt_txt.replace(/-/g, "/")}`);

					// skip if forecast el matches today's date
					if (date.getDate() === today.getDate())
					{
						continue;
					}

					// increment dayIdx if prev forecast date does not match current forecast date
					if (prevForecastElDate)
					{
						dayIdx += prevForecastElDate.getDate() !== date.getDate() ? 1 : 0;
					}

					// break loop if going over 5 days of forecast
					if (dayIdx > 4)
					{
						break;
					}

					// set date attribute if it doesn't exist
					if (!separatedForecast[dayIdx].date)
					{
						separatedForecast[dayIdx].date = date;
					}

					// dayIdx represents the day from which the forecast el comes from
					separatedForecast[dayIdx].forecast.push(forecastEl);
					prevForecastElDate = date;
				}

				// check if last element of separatedForecast has forecast data elements.  If no, remove it.
				// this is likely caused by OpenWeatherMap's API not providing enough data for a 5 day forecast.
				if (separatedForecast.slice(-1)[0].forecast.length === 0)
				{
					separatedForecast.splice(-1);
				}

				return separatedForecast;
			},

			// Consolidates a day's 3-hourly forecast into a single consolidated forecast
			consolidateToDailyForecast: function(forecastEl)
			{
				let id = this.getWeatherId(forecastEl.forecast);
				let prefix = this.getWeatherPrefix(forecastEl.forecast);
				let day = this.getWeatherDay(forecastEl.forecast);
				let main = this.getWeatherMain(forecastEl.forecast);
				let icon = this.getWeatherIcon(forecastEl.forecast);
				let desc = this.getWeatherDesc(forecastEl.forecast);
				let humidity = this.getAveHumidity(forecastEl.forecast);
				let pressure = this.getAvePressure(forecastEl.forecast);
				let windSpeed = this.getAveWindSpeed(forecastEl.forecast);
				let windDeg = this.getAveWindDeg(forecastEl.forecast);
				let [low, high] = this.getHighLowTemp(forecastEl.forecast);
				let ave = Math.round((((high + low) / 2) * 100) / 100);

				return {
					id: id,
					prefix: prefix,
					date: forecastEl.date,
					day: day,
					main: main,
					icon: icon,
					desc: desc,
					humidity: humidity,
					pressure: pressure,
					windSpeed: windSpeed,
					windDeg: windDeg,
					low: low,
					high: high,
					ave: ave
				};
			},

			getWeatherId: function(forecast)
			{
				let mainTracker = {};

				forecast.forEach(( forecastEl ) =>
				{
					let main = forecastEl.weather[0].id;
					mainTracker[`${main}`] = mainTracker[`${main}`] ? mainTracker[`${main}`] + 1 : 1;
				});

				return Object.keys.length === 1
					? Object.keys(mainTracker)[0]
					: Object.keys(mainTracker).reduce(( a, b ) =>
					{
						return mainTracker[a] > mainTracker[b] ? a : b;
					});
			},

